import Employetab from "./employetable";
import Empform from "./empform";
import { BroserROUTER as Router, Routes, Route, Link } from "react-router-dom";
function App14() {
  return (
    <div>
      <Router>
        <Routes>
          <Route path="/" element={<Employetab />} />
        </Routes>
      </Router>
    </div>
  );
}
export default App14;
